import logo from './logo.svg';
import './App.css';
import React, { useState, useEffect, useContext } from 'react';
import { Container } from '@material-ui/core';
import Header from './components/Header';
import axios from 'axios';

const getImages = () => {
  let imgs = [];
  const url = "https://api.pexels.com/v1/search?query=puppy";
  const key = "563492ad6f9170000100000165ea7564671b4e44a5ed43af8a717c07";
  axios.get(url, {
    headers: {
      Authorization: key
    },
  }).then(res => {
    imgs = res.data.photos;
  }).catch(err => console.log(err));
};

function App() {
  return (
    <Container className="App">
      <Header />
    </Container>
  );
}

export default App;
